import { SERVER_ROUTE } from "routes/serverRoutes.js";

export class ClientApi {
  static async fetchServerJson(url) {
    const response = await fetch(url);

    if (!response.ok) {
      console.log("Error", response.status, response);
      return null;
    }

    console.log(response);
    const json = await response.json();
    console.log("Client:", response.status, url, json);
    return json;
  }

  static async fetchRiotAccountByGameName(gameName, tagLine) {
    console.log("hi");
    const url = SERVER_ROUTE.ACCOUNT_BY_GAME_NAME(gameName, tagLine);
    const json = await this.fetchServerJson(url);
    return json;
  }

  static async fetchRiotSummonerByPuuid(puuid) {
    const url = SERVER_ROUTE.SUMMONER_BY_PUUID(puuid);
    const json = await this.fetchServerJson(url);
    return json;
  }

  static async fetchRiotMatchHistoryByPuuid(puuid) {
    const url = SERVER_ROUTE.MATCH_HISTORY_BY_PUUID(puuid);
    const json = await this.fetchServerJson(url);
    return json;
  }

  static async fetchMatchDataById(matchId) {
    const url = SERVER_ROUTE.MATCH_BY_ID(matchId);
    const json = await this.fetchServerJson(url);
    return json;
  }

  static async fetchAugmentData() {
    const url = SERVER_ROUTE.AUGMENT_DATA;
    const json = this.fetchServerJson(url);
    return json;
  }

  static async fetchItemData() {
    const url = SERVER_ROUTE.ITEM_DATA;
    const json = this.fetchServerJson(url);
    return json;
  }
}
